import React, { useState, useEffect } from 'react';
import './StudyPlansList.css';

function StudyPlansList({ searchTerm }) {
  const [plans, setPlans] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://localhost:8080/api/fields')
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        if (data.status === 'success') {
          setPlans(data.data);
        } else {
          throw new Error('Data fetch failed');
        }
        setLoading(false);
      })
      .catch(error => {
        setError(error.message);
        setLoading(false);
      });
  }, []);

  const filteredPlans = plans.filter(plan =>
    plan.fieldName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    plan.profileName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    plan.fieldCode.includes(searchTerm)
  );

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="study-plans-list">
      <h2>Учебные планы</h2>
      <table className="plans-table">
        <thead>
          <tr>
            <th>Код</th>
            <th>Название</th>
            <th>Уровень</th>
            <th>Длительность</th>
            <th>Профиль</th>
            <th>Квалификация</th>
          </tr>
        </thead>
        <tbody>
          {filteredPlans.map(plan => (
            <tr key={plan.fieldId}>
              <td>{plan.fieldCode}</td>
              <td>{plan.fieldName}</td>
              <td>{plan.degreeLevel}</td>
              <td>{plan.studyLength} года</td>
              <td>{plan.profileName}</td>
              <td>{plan.qualification || 'Не указана'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default StudyPlansList;
